import React, { Component } from "react";
import MyTabNav from "../components/MyTabNav";


class App extends Component {

  render() {
    return (
      <div className="container" aria-label="noteApp">
        <div>Notes On-The-Go</div>
        <MyTabNav />
      </div>
    );
  }
}

export default App;
